import React from "react";
import { Link } from "react-router-dom";
import { useState, useEffect } from "react";

const ProfilePage = () => {
  conts[(getUsers, setUsers, useEffect)] = useState([]);

  useEffect;

  return (
    <div className="profile">
      <div className="back">
        <Link to="/">
          <img
            src="https://image.shutterstock.com/image-vector/go-back-left-return-arrow-260nw-1452017738.jpg"
            alt=""
          />
        </Link>
      </div>
      <div>PROFILE INFO</div>
    </div>
  );
};

export default ProfilePage;
